import React from 'react';

const Rule = ({ index, text, passed }) => {
    return (
        <div style={{
            border: `1px solid ${passed ? 'green' : 'red'}`,
            backgroundColor: `${passed ? '#e6ffed' : '#ffe6e6'}`,
            padding: '10px',
            margin: '5px 0',
            borderRadius: '5px',
            display: 'flex',
            alignItems: 'center'
        }}>
            <span style={{ fontSize: '20px', marginRight: '10px' ,border}}>
                {passed ? '✓' : '✗'}
                <strong>Rule {index}</strong>
            </span>
            <div>

                <p>{text}</p>
            </div>
        </div>
    );
};

export default Rule;
